import {BrowserRouter as Router,Route,Routes} from"react-router-dom";
import logo from './logo.svg';
import './App.css';
import About from"./Component/About";
import Contact from"./Component/Contact";

import Home from"./Component/Home";
import Service from"./Component/Service";
import LoginPage from"./Component/LoginPage";
import { useState } from 'react';
import Feature from "./Component/Feature";
import Header from "./Layouts/Header";
import Profile from "./public/assets/images/person-icon.png";
import Pass from "./public/assets/images/lock.png";
import Email from "./public/assets/images/email.png";


function App() {
  const[email,setEmail]=useState("");
  const[password,setPassword]=useState("");
  const submitForm=()=>{

  }
  return (

    <>
    <Router>
      <Routes>
        <Route path="/about" element={<About/>}/>
        <Route path="/contact" element={<Contact/>}/>
        <Route path="/feature" element={<Feature/>}/>
        <Route path="/" element={<Home/>}/>
        <Route path="/service" element={<Service/>}/>
        <Route path="/loginPage" element={<LoginPage/>}/>


      </Routes>
    </Router>
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    <form action="" onSubmit={submitForm}>
      <td>
        <tr>
          <div>
            <label htmlFor="email">Email</label>
            <input type="text" name="email" id="email" autoComplete='off'value={email} onChange={(e)=>setEmail(e.target.value)}/>
          </div>
        </tr>
      </td>
      <div>
        <label htmlFor="password">Password</label>
        <input type="password" name="password" id="password"autoComplete='off'value={password} onChange={(e)=>setPassword(e.target.value)}/>
        <button type="submit">Login</button>
      </div>
      <div>
        <label htmlFor="name">Name</label>
        <input type="text" name="name" id="name"/>

      </div>
      <div>
        <label htmlFor="car">Car</label>
        <input type="text" name="car" id="car"/>
        <button type="submit">Login</button>
      </div>
    </form>

    </>
  );
}

export default App;
